import React, { useState, useEffect, useMemo } from 'react';
import { Container, Button, Select, MenuItem, Slider, Typography, Box, AppBar, Toolbar, CssBaseline, Switch, FormControlLabel, Divider } from '@mui/material';
import { createTheme, ThemeProvider, styled } from '@mui/material/styles';
import useMediaQuery from '@mui/material/useMediaQuery';
import axios from 'axios';
import DraggableWrapper from './DraggableWrapper'; // Import custom Draggable wrapper
import ResizableWrapper from './ResizableWrapper'; // Import custom Resizable wrapper
import 'react-resizable/css/styles.css';
import './App.css'; // Import CSS for transitions

// Import Roboto font if using npm
import '@fontsource/roboto/400.css';
import '@fontsource/roboto/700.css';

// Function to generate a random aesthetic color
const getRandomColor = () => {
  const hue = Math.floor(Math.random() * 360); // Random hue between 0 and 360
  const saturation = 70 + Math.random() * 20; // Saturation between 70% and 90%
  const lightness = 50 + Math.random() * 10; // Lightness between 50% and 60%
  return `hsl(${hue}, ${saturation}%, ${lightness}%)`;
};

// Custom hook to generate theme using Monet engine
const useMonetTheme = (darkMode) => {
  const primaryColor = getRandomColor();
  return useMemo(() => createTheme({
    palette: {
      mode: darkMode ? 'dark' : 'light',
      primary: { main: primaryColor },
      background: { default: darkMode ? '#121212' : '#f9f7fc', paper: darkMode ? '#1E1E1E' : '#FFFFFF' },
      text: { primary: darkMode ? '#E6E1E5' : '#1C1B1F' },
    },
    typography: {
      fontFamily: 'Roboto, sans-serif',
      fontWeightBold: 700,
      h4: { fontWeight: 700, fontSize: '1.5rem' },
      h6: { fontWeight: 700, fontSize: '1.25rem' },
      body1: { fontWeight: 400, fontSize: '1rem' },
    },
    shape: { borderRadius: 12 },
    components: {
      MuiButton: { styleOverrides: { root: { borderRadius: '12px', textTransform: 'none' } } },
      MuiPaper: { styleOverrides: { root: { padding: '16px', borderRadius: '12px', boxShadow: 'none' } } },
      MuiAppBar: { styleOverrides: { root: { borderRadius: '12px' } } },
    },
  }), [darkMode, primaryColor]);
};

const CustomSwitch = styled(Switch)(({ theme }) => ({
  width: 42,
  height: 26,
  padding: 0,
  display: 'flex',
  '&:hover': {
    '& .MuiSwitch-thumb': {
      boxShadow: '0 0 8px rgba(0, 0, 0, 0.3)',
    },
    '& .MuiSwitch-track': {
      backgroundColor: theme.palette.mode === 'dark' ? '#6b6b6b' : '#d0d0d0',
    },
  },
  '& .MuiSwitch-switchBase': {
    padding: 1,
    '&.Mui-checked': {
      transform: 'translateX(16px)',
      color: '#fff',
      '& + .MuiSwitch-track': {
        opacity: 1,
        backgroundColor: theme.palette.mode === 'dark' ? '#8796A5' : '#aab4be',
      },
    },
  },
  '& .MuiSwitch-thumb': {
    width: 24,
    height: 24,
    boxShadow: 'none',
  },
  '& .MuiSwitch-track': {
    borderRadius: 13,
    opacity: 1,
    backgroundColor: theme.palette.mode === 'dark' ? '#8796A5' : '#aab4be',
    boxSizing: 'border-box',
  },
}));

const CustomSlider = styled(Slider)(({ theme }) => ({
  color: theme.palette.primary.main,
  height: 8,
  '& .MuiSlider-thumb': {
    height: 24,
    width: 24,
    backgroundColor: '#fff',
    border: '2px solid currentColor',
    '&:hover': {
      boxShadow: '0 0 0 8px rgba(0, 0, 0, 0.16)',
    },
    '& .airbnb-bar': {
      height: 9,
      width: 1,
      backgroundColor: 'currentColor',
      marginLeft: 1,
      marginRight: 1,
    },
  },
  '& .MuiSlider-track': {
    height: 8,
    borderRadius: 4,
  },
  '& .MuiSlider-rail': {
    height: 8,
    borderRadius: 4,
  },
}));

function App() {
  const [model, setModel] = useState('');
  const [label, setLabel] = useState('');
  const [topK, setTopK] = useState(2);
  const [threshold, setThreshold] = useState(0.5);
  const [recommendations, setRecommendations] = useState([]);
  const [labels, setLabels] = useState([]);
  const [models, setModels] = useState([]);
  const [darkMode, setDarkMode] = useState(false);
  const [errorMessage, setErrorMessage] = useState('');

  const prefersDarkMode = useMediaQuery('(prefers-color-scheme: dark)');

  useEffect(() => {
    setDarkMode(prefersDarkMode);
  }, [prefersDarkMode]);

  useEffect(() => {
    // Fetch labels from the backend
    const fetchLabels = async () => {
      try {
        const response = await axios.get('http://localhost:5000/labels');
        console.log('Fetched labels:', response.data.labels); // Debug log
        setLabels(response.data.labels);
      } catch (error) {
        console.error('Error fetching labels:', error);
        if (error.response) {
          console.error('Error response data:', error.response.data);
        }
      }
    };
    fetchLabels();

    // Fetch model options from the backend
    const fetchModels = async () => {
      try {
        const response = await axios.get('http://localhost:5000/models');
        console.log('Fetched models:', response.data.models); // Debug log
        setModels(response.data.models);
      } catch (error) {
        console.error('Error fetching models:', error);
        if (error.response) {
          console.error('Error response data:', error.response.data);
        }
      }
    };
    fetchModels();
  }, []);

  const handleRunModel = async () => {
    if (!model || !label) {
      setErrorMessage('Please select both a model and a label before running the model.');
      return;
    }

    try {
      const response = await axios.post('http://localhost:5000/predict', {
        model, label, topK, threshold
      });
      console.log('Received recommendations:', response.data.recommendations); // Debug log
      setRecommendations(response.data.recommendations);
      setErrorMessage(''); // Clear error message on success
    } catch (error) {
      console.error('Error running model:', error);
      if (error.response) {
        console.error('Error response data:', error.response.data);
      }
      setErrorMessage('Error running model. Please try again.');
    }
  };

  const handleTopKChange = (event, newValue) => {
    setTopK(newValue);
  };

  const handleThresholdChange = (event, newValue) => {
    setThreshold(newValue);
  };

  const theme = useMonetTheme(darkMode);

  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />
      <AppBar position="static">
        <Toolbar>
          <Typography variant="h6" component="div" sx={{ flexGrow: 1 }}>
            Model Runner
          </Typography>
          <FormControlLabel
            control={<CustomSwitch checked={darkMode} onChange={() => setDarkMode(!darkMode)} />}
            label="Dark Mode"
          />
        </Toolbar>
      </AppBar>
      <Container>
        <Box my={4}>
          <Typography variant="h4" gutterBottom>
            Run Your Model
          </Typography>
          <Select
            value={model}
            onChange={(e) => setModel(e.target.value)}
            displayEmpty
            fullWidth
            variant="outlined"
            margin="normal"
          >
            <MenuItem value="" disabled>Select Model</MenuItem>
            {models.map((model) => (
              <MenuItem key={model.value} value={model.value}>{model.label}</MenuItem>
            ))}
          </Select>
          <Select
            value={label}
            onChange={(e) => setLabel(e.target.value)}
            displayEmpty
            fullWidth
            variant="outlined"
            margin="normal"
          >
            <MenuItem value="" disabled>Select Label</MenuItem>
            {labels.map((label) => (
              <MenuItem key={label.value} value={label.value}>{label.label}</MenuItem>
            ))}
          </Select>
          <Box mt={2}>
            <Typography gutterBottom>Top K: {topK}</Typography>
            <CustomSlider
              value={topK}
              onChange={handleTopKChange}
              aria-labelledby="top-k-slider"
              valueLabelDisplay="auto"
              step={1}
              marks
              min={1}
              max={10}
            />
          </Box>
          <Box mt={2}>
            <Typography gutterBottom>Threshold: {threshold}</Typography>
            <CustomSlider
              value={threshold}
              onChange={handleThresholdChange}
              aria-labelledby="threshold-slider"
              valueLabelDisplay="auto"
              step={0.1}
              marks
              min={0}
              max={1}
            />
          </Box>
          {errorMessage && (
            <Typography color="error" variant="body1" mt={2}>
              {errorMessage}
            </Typography>
          )}
          <Button variant="contained" color="primary" onClick={handleRunModel} fullWidth>
            Run Model
          </Button>
          {recommendations.length > 0 && (
            <Box mt={4}>
              <Typography variant="h5" gutterBottom sx={{ fontWeight: 'bold', color: 'text.primary' }}>
                Recommended nodes:
              </Typography>
              <Divider sx={{ my: 2 }} />
              <Box sx={{ p: 2, height: 'calc(100% - 48px)', overflow: 'auto' }}>
                {recommendations.map((rec, index) => (
                  <Typography key={index} variant="h6" gutterBottom>
                    {rec}
                  </Typography>
                ))}
              </Box>
            </Box>
          )}
        </Box>
      </Container>
    </ThemeProvider>
  );
}

export default App;
